        /**
         * 
         * @param type $option_name
         */
        public function reset_settings($option_name)
        {
            if (current_user_can('manage_options')) {
            ?>
                <div class="s9_section-header">
                    <h1><?php _e('Your Social9 Account is Activated.', 'Social9'); ?></h1>
                    <p><?php _e('Reset all the ' . $option_name . ' options to the default recommended settings.', 'Social9'); ?></p>
                </div>
                <div>
                    <form method="post" action="" class="s9-reset">
                        <?php submit_button('Reset All Options', 'primary', 'reset', false); ?>
                    </form>
                </div>

<?php
            }
        }

        /**
         * 
         * @param type $option
         * @param type $settings
         */
        public static function reset_settings_action($option, $settings)
        {
            if (current_user_can('manage_options')) {
                update_option($option, $settings);
            }
        }

        /**
         * Reset Sharing Settings.
         */
        public static function reset_share_options()
        {
            update_option('social9_account_id', '');
            update_option('social9_apikey', '');
            update_option('social9_access_token', '');
        }
